  04> McMECHAN, Rachel Jane
  b 11.09.1977
  Rachel 6. at Suva, Fiji. She was a student at Prince of Wales secondary school, Vancouver, BC
  and is now studying Zoology and History (BSc/BA) at Otago University.
  02> MACLEAN, Norman Haydon m on ** ** **** to FRASER, Isla Mary
  b 20.02.1946
  b 04.04.1949
  Norman b, at Marton. Isla, d/o Walter and May Burgess of Dunedin. Address: 1 Central Street,
  Gisborne.
  Norman was educated at Gisborne Boys' High School and trained as a teacher at Ardmore Teachers'
  College. He taught primary school for 22 years before being appointed Head of the Art department
  at Gisborne Boys' High School. In 1970-71 he travelled to Israel, Britain and Europe, returning to
  Gisborne Boys' High School then becoming Head of Art at Lytton High School in Gisborne.
  He has been a part-time teacher of Classical Studies at both Lytton and Gisborne Boys' High Schools
  and full-time teacher of drama at Gisborne Boys' High School.
  As an artist, Norman has exhibited in Gisborne and other centres. He is a founder member of the
  Gisborne Printmakers' Society. He specialises in zinc-plate etching, is a broadcaster on National
  Radio and directs theatre productions in Gisborne. He is also a public speaker and lecturer for
  Continuing Education courses, a writer of published articles and short stories and is currently
  engaged in major writing projects. Recently he was Tour Leader for a party visiting Jordan, Israel
  and Greece.
  03> MACLEAN, Gavin Wareham m on 25.11.1975 to MACDONALD, Catherine Flora
  b 07.05.1947
  b 04.05.1947
  Gavin b. at Wanganui and m, at St Barnabas Church, Kensington, London. Catherine, d/o Kenneth
  Macdonald and Catherine Mary Clements, b, at Hamilton. Address: "Cullerlie", RD 1, Gisborne.
  Gavin discovered music while studying physics at Otago University, met Catherine while singing in
  the Auckland Dorian Singers and teaching at Lynfield College (1970-72), and found green politics
  while singing with various teachers and small opera groups around London. This brought Gavin and
  Catherine back to the Gisborne homestead in 1976, as a base for low-impact living. Gavin works as a
  singer, singing teacher, woodturner, grower of trees, political activist, stage director, and
  conductor of the Gisborne Choral Society (since 1979). Catherine directs the music at St Andrew's
  Church and accepts solo singing engagements in opera and oratorio nationally.
  01> MACLEAN, Amanda Mary
  b 25.03.1983
  02> MACLEAN, Belinda Elsie
