  01>' MACLEAN, Christopher Edward Awdry (Ted) m on 25.02.1961 to (2)KEY, Muriel
  b 04.06.1915 d 09.01.1996
  b 29.08.1922
  Ted m. at New Plymouth. Muriel, d/o William Key and Emily Frances Jarvis, b. at Wimbledon, England,
  Ted was educated at Wanganui Collegiate School and was a retired journalist. He was advertising
  executive both for Wanganui and Taranaki Heralds. Muriel was a teacher. During WW2 Ted served in 27
  NZMG Battalion and 4 Battalion, Fiji Forces.
